int NeuralynxUDPConverter::GetNumberOfChannels()
{
	return _n_boards * CHANNELS_PER_BOARD;
}

bool NeuralynxUDPConverter::GetData(GenericSignal& Output, std::vector<uint32_t> chs, StateRef stamp, StateRef lost, std::vector<StateRef>& ttl)
{
	double elapsed_secs = 0.0;
	float* currItem;
	_n_samples = Output.Elements();
	DWORD res = WaitForSingleObject(m_sync_lock, 1000 * TIMEOUT_UDP);
	if (res != WAIT_OBJECT_0)
		return false;
	auto* pOutput = Output.MutableData();
	for (uint32_t i = 0; i < Output.Elements(); i++)
	{
		if (_receiveDataQueue.try_pop(currItem))
		{
			for (int ch = 0; ch < Output.Channels(); ch++)
				pOutput[Output.LinearIndex(ch, i)] = currItem[chs[ch]] * (_stream == NULL ? 0.000000015624999960550667 : 1); //gain value for low latency stream
			uint32_t ts = *reinterpret_cast<uint32_t*>(currItem + Output.Channels());
			stamp.Sample(i) = ts;
			uint32_t samplesLost = *reinterpret_cast<uint32_t*>(currItem + Output.Channels() + 1);
			lost.Sample(i) = samplesLost;
			uint32_t ttlval = *reinterpret_cast<uint32_t*>(currItem + Output.Channels() + 2);
			for (int j = 0; j < 32; ++j)
				ttl[j].Sample(i) = (ttlval & (1ul << j)) != 0 ? 1 : 0;
			::Free(currItem);
		}
		else
			return false; //return false if we couldnt get the item from a queue that should have all the data available
	}
	ResetEvent(m_sync_lock);
	return true;

}


NeuralynxUDPConverter::NeuralynxUDPConverter(NlxNetCom::NetComClient* comClient, uint32_t port, uint32_t n_boards) : _port(port),
_client(comClient), _stream(NULL), _udpSocket(INVALID_SOCKET), _inpBuffer(NULL), _decimationFactor(1), _valueBuffer(NULL), _filterIdx(0)
{
	_data_size = DATA_SIZE_PER_BOARD * n_boards;
	_package_size = HEADER_SIZE + _data_size + FOOTER_SIZE;
	_inpBuffer = new char[_package_size];
	_n_boards = n_boards;
	_doFetch = false;
	_runTask = true;
	m_sync_lock = CreateEvent(NULL, false, false, NULL);
	_n_samples = 1;
	_udpWorker = std::thread(&NeuralynxUDPConverter::fetchFromUdp, this);

}

NeuralynxUDPConverter::NeuralynxUDPConverter(std::string streamf, uint32_t n_boards, uint32_t samplingrate) : _doFetch(false),
_runTask(true), _client(NULL), _n_boards(n_boards), _udpSocket(INVALID_SOCKET), _inpBuffer(NULL), _decimationFactor(1), _valueBuffer(NULL), _filterIdx(0)
{
	_stream = new std::ifstream(streamf, std::ios::in | std::ios::binary);
	_stream->rdbuf()->pubsetbuf(_fileStreamBuffer, FILE_STREAM_BUFFER);
	//setvbuf(_stream, (char *)NULL, _IONBF, 0); //disable file buffering
	_data_size = DATA_SIZE_PER_BOARD * n_boards;
	_package_size = HEADER_SIZE + _data_size + FOOTER_SIZE;
	_inpBuffer = new char[_package_size * samplingrate];
	_doFetch = false;
	_runTask = true;
	m_sync_lock = CreateEvent(NULL, false, false, NULL);
	_n_samples = 1;
	_udpWorker = std::thread(&NeuralynxUDPConverter::fetchFromUdp, this);


}

NeuralynxUDPConverter::~NeuralynxUDPConverter()
{
	_doFetch = false;
	_runTask = false; //allows thread to shut down
	_udpWorker.join();
	delete[] _valueBuffer;
	CloseHandle(m_sync_lock);
	while (!_receiveDataQueue.empty())
	{
		float* buff = NULL;
		if (_receiveDataQueue.try_pop(buff))
			::Free(buff);
	}
	delete[] _inpBuffer;
	delete _stream;
	if (_udpSocket != INVALID_SOCKET)
		closesocket(_udpSocket);
	WSACleanup();
}

void NeuralynxUDPConverter::StartListening()
{
	_n_channels = CHANNELS_PER_BOARD * _n_boards;
	InitializeBuffers();
	configureUDP();
	delete[] _valueBuffer;
  _valueBuffer = NULL;
  if (_filterIdx != -1)
  {
    _valueBuffer = new int32_t[_n_channels * filterCoeffs[_filterIdx].size()];
    //configure LP filter
    if (_decimationFactor > 1)
    {

      for (int i = 0; i < filterCoeffs[_filterIdx].size() * _n_channels; ++i)
      {
        _valueBuffer[i] = 0;
      }

    }
  }

	_expPackageSize = 10 + CHANNELS_PER_BOARD * _n_boards;
	_currBlock = 0;
	_doFetch = true;
}

void NeuralynxUDPConverter::StopListening()
{
	_doFetch = false;
}

bool NeuralynxUDPConverter::configureUDP()
{
	WSADATA wsaData;
	int iResult;

	// Initialize Winsock
	iResult = WSAStartup(MAKEWORD(2, 2), &wsaData);
	if (iResult != 0)
	{
		WSACleanup();
		throw std::exception("WSA Startup failed %d\n", iResult);
	}

	_udpSocket = socket(AF_INET, SOCK_DGRAM, IPPROTO_UDP);
	if (_udpSocket == INVALID_SOCKET)
	{
		WSACleanup();
		throw std::exception("Failed to create UDP Socket");
	}


	_udpReceiver.sin_family = AF_INET;
	_udpReceiver.sin_port = htons(_port); // any port
	_udpReceiver.sin_addr.s_addr = htonl(INADDR_ANY);

	iResult = bind(_udpSocket, (SOCKADDR*)&_udpReceiver, sizeof(_udpReceiver));
	if (iResult == SOCKET_ERROR)
	{

		std::string errormsg = "Failed to bind UDP Socket: " + std::to_string(WSAGetLastError());
		WSACleanup();
		throw std::exception(errormsg.c_str());
	}

	int bufsize = (HEADER_SIZE + DATA_SIZE_PER_BOARD * _n_boards + FOOTER_SIZE) * 64000; // corresponding to 2s
	iResult = ::setsockopt(_udpSocket, SOL_SOCKET, SO_RCVBUF, reinterpret_cast<const char*>(&bufsize), sizeof(bufsize));
	if (iResult == SOCKET_ERROR)
	{

		std::string errormsg = "Failed to set UDP Socket receive buffer: " + std::to_string(WSAGetLastError());
		WSACleanup();
		throw std::exception(errormsg.c_str());
	}

	return true;
}

void NeuralynxUDPConverter::fetchFromUdp()
{
	WithThreadPriority(ThreadUtils::Priority::Maximum)
	{
		uint32_t* buffer = reinterpret_cast<uint32_t*>(_inpBuffer);
		uint32_t std_identifier = NlxDataTypes::NRDRec::STX;
		char* c_std_identifier = reinterpret_cast<char*>(&std_identifier);
		int32_t val = 0;
		//NlxDataTypes::NRDRec* currBufferItem = NULL;
		std::deque<char> q;
		int local_n = 1;
		uint32_t lastTs32 = 0;
		int64_t minDelta = std::numeric_limits<int64_t>::max();
		int32_t totalSamplesLost = 0;
		_currBlock = 0;
		while (_runTask)
		{
			try
			{

				if (_doFetch)
				{
					if ((_stream != NULL) && (_currBlock > 100)) // if we read from a file stream, lets wait if we have ~1000 items in the queue
					{
						Sleep(10);
						_currBlock = 0; //slowing down read from file...
						continue;
					}

					if (_stream != NULL)
					{
						//check for start of package in file
						//currBufferItem = _records.GetCurrentItem();
						int num_received = receive(_inpBuffer, 1);
						if (q.size() >= sizeof(uint32_t))
							q.pop_front();

						q.push_back(_inpBuffer[0]);

						if (q.size() == sizeof(uint32_t))
						{ //check if it matches magic word
							bool is_magic_word = true;
							for (int i = 0; i < sizeof(uint32_t); i++)
							{
								is_magic_word &= (q[i] == c_std_identifier[i]);

							}
							if (!is_magic_word)
								continue;
						}
						else
						{
							continue;
						}
						//_stxBuffer.CopyToBuffer(_inpBuffer, true);

						//if (!_stxBuffer.equals(reinterpret_cast<char*>(&std_identifier), sizeof(uint32_t)))
						//{
						//	continue;
						//}
						local_n = 1;
						if (receive(_inpBuffer + sizeof(std_identifier), _package_size - sizeof(std_identifier)) == 0)
							continue;
					}
					else
					{
						if (receive(_inpBuffer, _package_size) == 0) //get whole package in UDP mode
						{
							//Sleep(0);
							continue;
						}
					}

					//currBufferItem->PacketID = buffer[1];
					//currBufferItem->PacketSize = buffer[2];


					if (buffer[2] != _expPackageSize) //defunct package
						continue;

					// we assume that this package is valid so we can increment the buffer
					_currBlock++;

					// get the block's TTL (ParallelPortInput) value
					uint32_t ttlVal = buffer[6];
	
					// inspect the block's timestamp to detect any dropped packets
					union { const uint32_t* i; const uint64_t* l; } ts = { &buffer[3] };
					uint32_t ts32 = *ts.l >> 32;
					if (_currBlock > 1)
					{
						int64_t delta = ts32 - lastTs32;
						if (delta > 0) // ignore wraparound
						{
							minDelta = std::min(delta, minDelta);
							int64_t samplesLost = (2 * delta + 1) / minDelta / 2 - 1;
							if (samplesLost > 0)
								bciwarn << "Lost " << samplesLost << " samples";
							else if (samplesLost < 0)
								samplesLost = 0;	
							totalSamplesLost += samplesLost;
						}
					}
					lastTs32 = ts32;

					float* dat = NULL;
					if ((_currBlock % _decimationFactor) == 0)
						dat = (float*)::Alloc((_n_channels + 3) * sizeof(float));

					if (_decimationFactor > 1)
					{
						for (uint32_t ch = 0; ch < _n_channels; ++ch)
						{
							val = *reinterpret_cast<int32_t*>((_inpBuffer + HEADER_SIZE + ch * sizeof(int32_t)));
							_valueBuffer[ch * filterCoeffs[_filterIdx].size() + filterCoeffs[_filterIdx].size() - 1] = val;

							if (dat != NULL) //we only need to calculate the filter output for non-decimated values
							{
								dat[ch] = 0;
								for (uint16_t i = 0; i < filterCoeffs[_filterIdx].size(); ++i) //i=0 - x[n-N]*b[N]
									dat[ch] += (_valueBuffer[ch * filterCoeffs[_filterIdx].size() + i] * filterCoeffs[_filterIdx][i]);

							}

							//rotate array
							//std::copy()
               //in the future - change this to circular buffer implementation!
							memcpy(_valueBuffer + (filterCoeffs[_filterIdx].size() * ch), _valueBuffer + (filterCoeffs[_filterIdx].size() *ch) + 1, sizeof(int32_t) * filterCoeffs[_filterIdx].size()-1);
							//for (int i = 0; i < _decimationFactor - 1; ++i)
							//	_valueBuffer[ch*_decimationFactor + i] = _valueBuffer[ch*_decimationFactor + i + 1];

						}
					}
					else
					{

						for (int ch = 0; ch < _n_channels; ++ch)
						{
							val = *reinterpret_cast<int32_t*>((_inpBuffer + HEADER_SIZE + ch * sizeof(int32_t)));
							dat[ch] = val;
						}
					}
					if (dat != nullptr)
					{
						*reinterpret_cast<uint32_t*>(dat + _n_channels) = ts32;
						*reinterpret_cast<uint32_t*>(dat + _n_channels + 1) = totalSamplesLost;
						*reinterpret_cast<uint32_t*>(dat + _n_channels + 2) = ttlVal;
						totalSamplesLost = 0;
					}
					if (dat == NULL)
						continue;

					_receiveDataQueue.push(dat);
					if (_receiveDataQueue.unsafe_size() >= _n_samples)
					{
						SetEvent(m_sync_lock);

					}
				}
				//_receivedData.Produce(dat);
				else
				{
	//				Sleep(0);
				}
			}
			catch (std::exception e)
			{
				std::cout << e.what() << std::endl;
			}

		}
	}

}

void NeuralynxUDPConverter::SetDecimation(uint32_t dec)
{
  if (dec == 1)
  {
    _decimationFactor = dec;
    _filterIdx = -1;
  }
  else
  {
    uint32_t* res = std::find(std::begin(decimate), std::end(decimate), dec);
    // When the element is not found, std::find returns the end of the range
    if (res != std::end(decimate)) {
      _filterIdx = res - std::begin(decimate);
    }
    else {
      throw Exception("Invalid decimation factor!");
    }
    _decimationFactor = dec;
  }
  

}

