int NeuralynxUDPConverter::receive(void* buffer, uint32_t receive_size)
{
	if (_stream == NULL)
	{
#if 0
		fd_set fds;
		int n;
		struct timeval tv;
		FD_ZERO(&fds);
		FD_SET(_udpSocket, &fds);

		tv.tv_sec = TIMEOUT_UDP;
		tv.tv_usec = 0;

		if (select(_udpSocket + 1, &fds, NULL, NULL, &tv) <= 0)
			throw std::exception("Timeout during UDP receive");
#endif

		int SenderAddrSize = sizeof(_udpReceiver);
		int retval = recvfrom(_udpSocket, reinterpret_cast<char*>(buffer), receive_size, 0, (SOCKADDR*)&_udpReceiver, &SenderAddrSize);
		if (retval < 0)
		{
			uint32_t err = WSAGetLastError();
			std::string errmsg = "Error during receive from UDP Stream: " + std::to_string(err);
			throw std::exception(errmsg.c_str());
		}
		return retval;
	}
	else
	{
		if (_stream->read(reinterpret_cast<char*>(buffer), receive_size).eof())
		{
			_stream->clear();
			_stream->seekg(0);
			return 0;
		}
		else
			return _stream->gcount();

	}
}


